Example 4:

Input: word = "dabbdddd", k = 3
Output: 7
Explanation: You can delete "dab" resulting in "dd" or "abb" resulting in "d".


Constraints:

1 <= k <= word.length <= 10^5
All characters of word are lower case English letters.

